import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class Link extends Component {
  render() {
    const link = this.props.link;

    return (
      <NavLink
        to={`/${link.page}`}
        exact
        id={link.name}
        className='Link'
      >
        {link.page}
        <img
          src={link.image}
          alt={link.page}
        />
      </NavLink>
    )
  }
  ///////////////////////


}

export default Link;
